import React from 'react'
import HocusFocus from '../components/HocusFocus'
import EmptyNavbar from '../components/Navbar/emptyNav'

const hocusfocus = () => {
    return (
        <div>
            <EmptyNavbar/>
            <HocusFocus/>
        </div>
    )
}

export default hocusfocus
